        and to provide consumers with adequate information to make informed decisions
        about their use.

        Classification of Dangerous Preparations:

        The 333/134/EU directive defines dangerous preparations as those that have
        a potential risk to human health or the environment during their manufacturing,
        handling, storage, transportation, or use. The directive sets out criteria
        for classifying dangerous preparations into different categories based on
        their level of danger:

        * Category 1: extremely dangerous preparations (e.g., explosives, highly toxic
        substances)

        * Category 2: dangerous preparations (e.g., corrosive substances, irritant
        substances)

        * Category 3: hazardous preparations (e.g., sensitizing substances, respiratory
        sensitizers)

        Packaging and Labelling Requirements:

        The 3333/134/EU directive sets out specific requirements for the packaging
        and labelling of dangerous preparations. These include:

        * Packaging: Dangerous preparations must be packaged in a way that prevents
        leakage or spillage during transportation, storage, or use. The packaging
        must also be clearly marked with the appropriate warning signs (e.g., "Danger,"
        "Toxic") and pictograms.

        * Labelling: Dangerous preparations must be labelled with their name, manufacturer,
        and any relevant handling instructions. The label must also include a pictogram
        indicating the level of danger posed by the preparation (e.g., a skull and
